webpackJsonp([0xfd2a3f7081bb],{6581:function(e,a){e.exports={data:{post:{html:'<p>Nothing was found, and the information may not have been as concrete as officials in Hamburg had implied. <a title="tagesschau.de : Kein Sprengstoff in Hamburg gefunden" href="http://tagesschau.de/aktuell/meldungen/0,1185,OID2806070_NAV_REF1,00.html">Federal Interior Minister Schily</a> said last night that he regrets that the police action in Hamburg prematurely made the warnings public. Hamburg officials may be nervous as a result of the ongoing political turmoil in the city; the parliament dissolved itself yesterday to clear the way for early elections in February.</p>',fields:{title:"Update: Terror Alarm in Hamburg",date:"31 Dec 2003",url:"https://papascott.de/2003-12-31-update-terror-alarm-in-hamburg/"}}},pathContext:{slug:"/2003-12-31-update-terror-alarm-in-hamburg/",prev:{fields:{title:"SMS Spam Wanted",date:"31 Dec 2003",slug:"/2003-12-31-sms-spam-wanted/"}},next:{fields:{title:"Brazil fingerprints and photographs arriving Americans",date:"02 Jan 2004",slug:"/2004-01-02-brazil-fingerprints-and-photographs-arriving-americans/"}}}}}});
